import React, {Component} from "react"
import {Navbar, Nav, NavDropdown, Form, FormControl, Button} from 'react-bootstrap';
import {fetchData} from "./store/actions";
import './App.css';
import {BrowserRouter, Switch, Route} from 'react-router-dom';
import HomeComponent from "./Components/HomeComponent";
import LoginComponent from "./Components/Login/LoginComponent"

class App extends Component<any> {

//constuructor is for creating a state at initialization.
//   constructor(props: any) {
//     super(props);
//     // this.onChangeName = this.onChangeName.bind(this);
//     // this.onChangeEmail = this.onChange.bind(this);
//     // this.onChangePhone = this.onChangePhone.bind(this);
//     // this.onSubmit = this.onSubmit.bind(this);

// }



  componentDidMount(){

    this.props.dispatch(fetchData())

    // axios.get("http://127.0.0.1:8000/posts/posts/").then((response) => {
    //   let posts: string | number = response.data;
    //   //putting the content in state
    //   this.setState({posts: posts})
    // })
  }


  render(){
    return (
      <div className="App">

        {/* NavBar */}
        <Navbar id="nav" bg="light" expand="lg">
          <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
              <Nav.Link href="#home">Home</Nav.Link>
              <Nav.Link href="#link">Link</Nav.Link>
              <NavDropdown title="Dropdown" id="basic-nav-dropdown">
                <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
              </NavDropdown>
            </Nav>
            <Form inline>
              <FormControl type="text" placeholder="Search" className="mr-sm-2" />
              <Button variant="outline-success">Search</Button>
              <Button id="login" href="/login">Login</Button>
            </Form>

          </Navbar.Collapse>
        </Navbar>

        {/* Pages */}
        <BrowserRouter>
          <Switch>
            <Route exact={true} path="/" component={HomeComponent}/>
            <Route exact={true} path="/login" component={LoginComponent}/>
          </Switch>
        </BrowserRouter>
      </div> 
    );
  }
}

export default App;
